func (c *Client) V1UploadMediaWithBody(ctx context.Context, externalId PathMediaExternalId, name string, media io.Reader, reqEditors ...RequestEditorFn) (*http.Response, error) {
	// 2. Читаем данные изображения
	imageData, err := io.ReadAll(media)
	if err != nil {
		return nil, fmt.Errorf("ошибка при чтении данных изображения: %v", err)
	}

	// 3. Создаем multipart форму
	body := &bytes.Buffer{}
	writer := multipart.NewWriter(body)

	// 4. Создаем поле формы для файла
	part, err := writer.CreateFormFile("media_file", name)
	if err != nil {
		return nil, fmt.Errorf("ошибка при создании поля формы: %v", err)
	}

	// 5. Записываем данные изображения в поле формы
	_, err = part.Write(imageData)
	if err != nil {
		return nil, fmt.Errorf("ошибка при записи данных в форму: %v", err)
	}

	// 6. Закрываем writer (это важно для корректного формирования формы)
	err = writer.Close()
	if err != nil {
		return nil, fmt.Errorf("ошибка при закрытии writer: %v", err)
	}

	req, err := NewV1UploadMediaRequestWithBody(c.Server, externalId, writer.FormDataContentType(), body)
	if err != nil {
		return nil, err
	}
	req = req.WithContext(ctx)
	if err := c.applyEditors(ctx, req, reqEditors); err != nil {
		return nil, err
	}

	return c.Client.Do(req)
}

